<html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">

        <title>DXT Explorer</title>

        <link href="https://fonts.googleapis.com/css?family=IBM+Plex+Mono:400,400i|IBM+Plex+Sans+Condensed:400,400i|IBM+Plex+Sans:100,100i,400,400i,700,700i|IBM+Plex+Serif:400,400i" rel="stylesheet">

        <style type="text/css">
            html {
                color: #2e2e2e;
                font-family: 'IBM Plex Sans', sans-serif;
                font-size: 14px;
                line-height: 22px;
                padding: 20px;
            }

            h1 {
                margin: 0;
                padding: 0;
            }

            h2 {
                color: #1f3c81;
                font-family: 'IBM Plex Mono', monospace;
                font-size: 12px;
                padding: 0 5px;
                margin: 0;
            }

            header, footer {
                color: #888;
                font-family: 'IBM Plex Mono', monospace;
                font-size: 10px;
                padding: 0 5px;
            }

            a {
                font-size: 14px;
                text-decoration: none;
                background: #395393;
                color: #fff;
                border-radius: 3px;
                padding: 3px 10px;
                display: inline-block;
                font-weight: bold;
                font-size: 12px;
                transition: 0.1s;
            }

            a:hover {
                background: #c8ab66;
            }

            ul {
                list-style-color: #c8ab66;
                padding-inline-start:  5px;
            }

            ul li {
                background: #efefef;
                border-radius: 3px;
                font-family: 'IBM Plex Mono', monospace;
                font-size: 10px;
                margin: 0 0 14px;
                padding: 5px 10px;
            }

            ul.buttons {
                margin: 5px 0;
                padding: 0;
                padding-inline-start: 0;
            }

            ul.buttons li {
                display: inline-block;
                padding: 0;
                margin: 0;
            }

            DRISHTI_STYLE
        </style>
    </head>
